import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import { Security } from '@okta/okta-react'; // Import Okta components
import oktaConfig from './oktaConfig'; // Import your Okta configuration

import App from './App';

ReactDOM.render(
  <Router>
    <Security oktaAuth={oktaConfig.oidc}> {/* Wrap your app with Okta Security */}
      <App />
    </Security>
  </Router>,
  document.getElementById('root')
);
